import { useLocation} from 'react-router-dom';


export function Menu(){
    let location = useLocation();
    let Tipo: String = "";
    switch(location.pathname){
        case '/ComidaRapida' :
            Tipo = "Comida Rapida";
            break;
        case '/Ensaladas' :
            Tipo = "Ensalada";
            break;
        case '/Desayunos' :
            Tipo = "Desayunos";
            break;
            
    }
    return(
        <div>
            {Tipo}
        </div>
    );
}
